INSERT INTO `news` VALUES ('2f1cb4991f4c4fd6943f55b4fb606471', '美国男子用电脑控制自己所乘波音737飞机', '近日，美国计算机安全专家罗伯茨坚信飞机上的娱乐系统存在漏洞，为了证明自己的理论，他黑掉了所坐航班的安全系 统。罗伯茨说在高空我们能毫无察觉的关闭飞机引擎，同时保证驾驶舱里的闪光灯正常亮着。飞机降落后，罗伯茨和他的电脑被FBI请下了航班。', '', '央视2015年04月20日 10:52', '2015-04-20 15:18:52', null, '2015-04-20 15:18:52', '2015-05-13 10:51:58', 'zhou', 'zhou', null, , '11', 'http://img6.cache.netease.com/cnews/2015/4/20/201504201051210a639.jpg');
