INSERT INTO `news` VALUES ('6d730e66883a4e9193c5d2b4c2b326ad', 'LG着急曝光苹果新品计划：8K屏的iMac', '半年前，苹果才刚刚发布了27寸、5K显示屏的最新一代iMac产品。所以说这次苹果如果真是打算发布8K分辨率的iMac，就难免显得有些“急不可耐”，不符合一贯的作风。另外，还没等到苹果公司做出官方声明，合作伙伴LG就如此着急的踢爆新品计划，当然会让人感到诡异。实际情况究竟如何，我们还是要等当事人苹果来给出答复。（王泱）', '', '', '2015-04-07 14:57:01', null, '2015-04-07 14:57:01', '2015-04-07 14:57:01', 'zhou', 'zhou', null, , '1', 'http://img5.cache.netease.com/tech/2015/4/7/2015040700290730e1e_550.jpg');
