INSERT INTO `news` VALUES ('bdb31122cffc496c82512d2e06347a66', 'iOS8.3除Touch ID问题外 WiFi问题依旧没有解决', '继之前有网友爆料iPhone 6/6 Plus升级至最新的iOS 8.3系统后，Touch ID无法在iTunes和苹果应用商店使用Touch ID进行支付之后，WIFI又出了问题。一加OxygenOS今天下午正式发布，我们迅速下载并安装了这一版本试用，OxygenOS基于Android 5.0.2版本开发，相比之前使用的Color OS，OxygenOS的易用性有所提升，在一加手机上的操作也十分流畅。值得注意的是，由于正处于初步完工的阶段，系统并没有经过深度的修改，与Android Lolipop原生版本的体验较为接近，由于是国际版，许多谷歌Android原生内容并没有像国内版本一样被清理掉。以下是我们的第一手截图：\n可以说，iOS 8是苹果iOS系统中BUG最多的一个版本，要是哪天没有BUG了才是不正常呢。\n\n虽然苹果在iOS 8.3中修复了WIFI问题，但是WiFi依然不稳定。频繁断开的问题依旧存在，同时开启耗电量也比之前的版本加快很多(至少快10%)。', '', '', '2015-04-07 17:40:41', null, '2015-04-07 17:40:41', '2015-04-10 11:52:01', 'zhou', 'zhou', null, , '18', 'http://static.cnbetacdn.com/article/2015/0410/0fa9ccb3fa9f178.jpg');
