INSERT INTO `news` VALUES ('d61662e1e7a94d79b08b709bebd32fa9', '今日特辑3——俄媒称歼20战机2年后将装全套武器 最初任务曝光', '但是尽管目前歼-20才处于第一阶段，但是已经拥有优越的隐身性能和高速度，可以成为“航母杀手”、预警机和敌方地面雷达的“克星”。报道称，目前T-50使用由两台117发动机组成的动力装置，未来T-50将装备第二阶段的发动机，推力能达到176/107千牛。歼-20也必须走过这样的两个阶段。但是尽管目前歼-20才处于第一阶段，但是已经拥有优越的隐身性能和高速度，可以成为“航母杀手”、预警机和敌方地面雷达的“克星”。(知远)', '', '', '2015-04-10 15:54:49', null, '2015-04-10 15:54:49', '2015-04-14 15:28:50', 'minmin', 'minmin', null, , '50', 'http://www.sinaimg.cn/dy/slidenews/8_t500/2015_15/193_137189_590049.jpg');
INSERT INTO `news` VALUES ('d6356d750ed84445a6637fdbcf5aa6d2', '今日特辑1 —— 落在身边的钱币', '果然是班主任在晾晒衣物，那几枚硬币大概是从班主任的衣服兜里滑出来的。班主任非常惊喜，接过那几枚硬币，很客气地感谢了亮子。亮子乐滋滋的，庆幸自己做了件好事。没有想到的是，为了此事，班主任还在课堂上当着全班同学的面，大张旗鼓地表扬了他。说他拾金不昧，还号召同学们向他学习。亮子可是第一次受到这样的荣誉，他为自己骄傲，也更为自己惭愧。', '又见沂蒙', '又见沂蒙', '2015-04-09 11:42:18', null, '2015-04-09 11:42:18', '2015-04-10 14:47:14', 'minmin', 'minmin', null, , '23', 'http://172.16.10.49:8089/CNAACPortal/resource/personal/news/upload/image/20150409/1428550928843054330.jpg');
