-- ----------------------------
-- Table structure for `application`
-- ----------------------------
DROP TABLE IF EXISTS `application`;
CREATE TABLE `application` (
  `uuid` varchar(36) NOT NULL,
  `user_uuid` varchar(36) NOT NULL,
  `app_name` varchar(100) DEFAULT NULL,
  `apk_name` varchar(100) DEFAULT NULL,
  `app_path` varchar(100) DEFAULT NULL,
  `app_reinforce_path` varchar(100) DEFAULT NULL,
  `app_icon` varchar(100) DEFAULT NULL,
  `app_version` varchar(30) DEFAULT NULL,
  `app_status` varchar(10) DEFAULT NULL COMMENT '1.apply scan success , 2.apply scan fail , 3.scan progressing 4.scan success , 5.scan fail , 6.reinforce success , 7.reinforce fail , 8.signature success , 9.Signature fail',
  `upload_time` datetime DEFAULT NULL,
  `scan_task_id` varchar(100) DEFAULT NULL,
  `scan_msg` varchar(1000) DEFAULT NULL,
  `scan_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `app_size` varchar(20) DEFAULT NULL,
  `harding_task_id` varchar(100) DEFAULT NULL,
  `harding_time` datetime DEFAULT NULL,
  `harding_msg` varchar(1000) DEFAULT NULL,
  `apkid` varchar(500) DEFAULT NULL,
  `is_verify_sign` char(1) DEFAULT NULL COMMENT '0: not verify, 1 must verify.',
  `is_channel_app` char(1) DEFAULT '0' COMMENT '0, 非渠道应用, 1. 渠道应用',
  `fileHashCode` varchar(100) DEFAULT NULL COMMENT '只有渠道用户才有fileHashCode',
  PRIMARY KEY (`uuid`),
  KEY `user_application_fk_idx` (`user_uuid`),
  CONSTRAINT `user_application_fk` FOREIGN KEY (`user_uuid`) REFERENCES `user` (`uuid`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of application
-- ----------------------------

