  `audit_result` varchar(10) DEFAULT NULL COMMENT '3.audit passed , 4.failed to pass the audit',
  `reason` varchar(1000) DEFAULT NULL,
  `audit_time` datetime DEFAULT NULL,
  `audit_by` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_audit_history_user1_idx` (`user_uuid`),
  CONSTRAINT `fk_audit_history_user1` FOREIGN KEY (`user_uuid`) REFERENCES `user` (`uuid`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=87 DEFAULT CHARSET=utf8;

