-- Table structure for `consume_record`
-- ----------------------------
DROP TABLE IF EXISTS `consume_record`;
CREATE TABLE `consume_record` (
  `uuid` varchar(64) NOT NULL,
  `user_uuid` varchar(50) NOT NULL,
  `con_bizno` varchar(64) DEFAULT NULL COMMENT '流水号,如:20150617125121',
  `con_name` varchar(256) DEFAULT NULL COMMENT '名称备注',
  `con_amount` decimal(10,2) DEFAULT NULL COMMENT '金额',
  `con_type` varchar(16) DEFAULT NULL COMMENT '类型 1:收入 2:支出',
  `con_out_bizno` varchar(64) DEFAULT NULL COMMENT '外部交易号,如支付宝交易号',
  `con_status` varchar(16) NOT NULL DEFAULT '' COMMENT '交易状态，1：等待付款，2：交易成功，3：交易取消',
  `con_time` datetime DEFAULT NULL COMMENT '创建时间',
  `con_update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

