  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `audit_time` datetime DEFAULT NULL,
  `company_uuid` varchar(36) DEFAULT NULL,
  `certificate_path` varchar(100) DEFAULT NULL,
  `balance` decimal(10,2) DEFAULT NULL,
  PRIMARY KEY (`uuid`),
  UNIQUE KEY `email_UNIQUE` (`email`),
  KEY `fk_user_company_idx` (`company_uuid`),
  CONSTRAINT `fk_user_company` FOREIGN KEY (`company_uuid`) REFERENCES `company` (`uuid`) ON DELETE NO ACTION ON UPDATE NO ACTION
